import React from 'react'
import './header.css'; 

function Header() {
    return (
        <div className="container">
            <div className="wrap">
                <div className="title"></div>
                <div className="searchBar"></div>
                <div className="icons"></div>
                <div className="profile"></div>
            </div>
        </div>
    )
}

export default Header
